/* Tabla 'inmueble'
Representa la cantidad de departamentos (inmuebles) que tiene cada consorcio.
Cada consoricio puede tener inmuebles asignados o no. Pueden existir inmuebles que todavía no fueron asignados a un consorcio.
Cada inmueble pertenece solo a un consorcio.
En cada consorcio, los departamentos (inmuebles) se de distribuyen en pisos, siendo '0': Planta baja, '1' 1er piso, etc.
Cada departamento dentro de un piso, se identifica con una letra A, B, C, ...
Un departamento, puede estar ubicado en el frente del edificio, y se identifica con el valor 1 en caso afirmativo, o 0 en caso contrario.
De la misma manera si tiene o no tiene balcón. 
Todos los departamentos ubicados en planta baja no cuentan con balcon.

Cada consorcio puede tener 1 o 2 pisos. En cada piso pueden haber 2 o 3 departamentos.
*/
-- DROP TABLE inmueble;
CREATE TABLE inmueble(
	 idinmueble  INT NOT NULL,
	 nro_piso INT,
	 dpto Varchar(1), -- 'A a 
	 sup_Cubierta DECIMAL(6,2),
	 frente bit, -- 0-S 1-N
	 balcon bit, -- 0-S 1-N
	 idprovincia INT NULL,
	 idlocalidad INT NULL,
	 idconsorcio INT NULL
 );

ALTER TABLE inmueble
	ADD CONSTRAINT PK_inmueble PRIMARY KEY (idinmueble);

ALTER TABLE inmueble
	ADD CONSTRAINT FK_inmueble_consorcio FOREIGN KEY(idprovincia, idlocalidad, idconsorcio)
	REFERENCES consorcio(idprovincia, idlocalidad, idconsorcio);	

-- TRUNCATE TABLE inmueble;


SELECT * FROM inmueble;